#Premiere fonction

def occurences(data):

	dict_occ = dict()
	#on initialise les valeurs du dico a 0 pour eviter les ErroKey
	for i in range(L):
		d=dict()
		for a in A:
			d[a]=0
		dict_occ[i]=d
		

	
	for i in range(L):
		
		for m in range(M):
			#print data[m,i]
			dict_occ[i][data[m,i]]+=1

	return dict_occ
	



		
	
