def entropie(wi, q):
	# Si = log2(q) + sum a dans A (wi(a).log2[wi(a)])
	# A tout les acides en position

	
	somme = math.log(q, 2);

	for a in wi.values():
	
		somme+=a*math.log(a, 2)

	return  somme


def entropies(w,q):
	
	entrops=[]
	for i,wi in w.items():
			
			entrops.append((i, entropie(wi,q)))
			
	
	return entrops
	


