#Renvoie la liste des valeurs de M trier par ordre decroissant
def trier(matrice):

	liste=[]

	for i in range(L):
		for j in range(L):

			liste.append((i,j,matrice[i][j],math.fabs(i-j)))


	return sorted(liste, key=lambda liste_mut: liste_mut[2], reverse=True)


#Renvoie la liste des fractions du nombre de paires de positions les plus proches par rapport au nombre de paires selectionnees
def fraction(k,liste_mut):

	liste_nb=[]
	liste_frac=[]
	cpt=0

	for i in range(1,k):

		liste_nb.append(i);

		if(liste_mut[i][3]<8):
			cpt+=1

		liste_frac.append((i,float(cpt)/i))

	return liste_frac


